    private void createMapGame() {
        String filename1 = "src/main/resources/map/";
        String filename2 = "src/main/resources/audio/scenery/";

        var pier = SceneryBuilder.builder()
                .exits("oeste", "farol")
                .exits("norte", "floresta")
                .exits("leste", "praia")
                .song(filename2 + "cais.wav")
                .name("cais").image(filename1 + "cais.png")
                .doors(new Door(12, ICoordinate.getInstance(30, 52), true))
                .limits(limitsPier()).build();

        var lighthouse = SceneryBuilder.builder()
                .exits("leste", "cais")
                .song(filename2 + "farol.wav")
                .name("farol").image(filename1 + "farol.png")
                .doors(new Door(3, ICoordinate.getInstance(27, 24), true))
                .itens("pa").limits(limitsLighthouse()).build();

        var lighthouseRoom = RoomBuilder.builder().name("dentro do farol").image(filename1 + "dentro-do-farol.png")
                .doors(new Door(2, ICoordinate.getInstance(72, 26), true))
                .itens("faca").itens("pregos").limits(limitsLighthouseRoom()).build();

        var beach = SceneryBuilder.builder()
                .exits("oeste", "cais")
                .song(filename2 + "praia.wav")
                .name("praia").image(filename1 + "praia.png")
                .itens("chave").limits(limitsBeach()).build();

        var forest = SceneryBuilder.builder()
                .exits("sul", "cais")
                .exits("norte", "vila")
                .name("floresta").image(filename1 + "floresta.png")
                .itens("madeiras").limits(limitsForest()).build();

        var village = SceneryBuilder.builder()
                .exits("sul", "floresta")
                .song(filename2 + "vila.wav")
                .name("vila").image(filename1 + "vila.png")
                .doors(new Door(7, ICoordinate.getInstance(14, 38), true))
                .doors(new Door(11, ICoordinate.getInstance(72, 31), true))
                .doors(new Door(8, ICoordinate.getInstance(37, 15), false))
                .limits(limitsVillage()).build();

        var accommodation = RoomBuilder.builder().name("alojamento").image(filename1 + "alojamento.png")
                .doors(new Door(6, ICoordinate.getInstance(50, 51), true))
                .itens("martelo").itens("papel").limits(limitsAccommodation()).build();

        var temple = RoomBuilder.builder()
                .song(filename2 + "templo.wav")
                .name("templo").image(filename1 + "templo.png")
                .doors(new Door(6, ICoordinate.getInstance(38, 53), false))
                .doors(new Door(9, ICoordinate.getInstance(26, 19), false))
                .doors(new Door(10, ICoordinate.getInstance(9, 24), false))
                .itens("madeira").limits(limitsTemple()).build();

        var topTemple = RoomBuilder.builder().name("topo do templo").image(filename1 + "topo-do-templo.png")
                .doors(new Door(8, ICoordinate.getInstance(250, 180), false))
                .itens("pederneira").limits(limitsTopTemple()).build();

        var basement = RoomBuilder.builder().name("porao do templo").image(filename1 + "porao.png")
                .doors(new Door(8, ICoordinate.getInstance(100, 150), false))
                .itens("tesouro").limits(limitsBasement()).build();

        var nursery = RoomBuilder.builder().name("enfermaria").image(filename1 + "enfermaria.png")
                .doors(new Door(6, ICoordinate.getInstance(370, 510), true))
                .itens("frasco").itens("livro").limits(limitsNursery()).build();

        var boat = RoomBuilder.builder().name("barco").image(filename1 + "barco.png")
                .doors(new Door(1, ICoordinate.getInstance(70, 320), true))
                .itens("mochila").limits(limitsBoat()).build();

        mapGames.add(pier);
        mapGames.add(lighthouse);
        mapGames.add(lighthouseRoom);
        mapGames.add(beach);
        mapGames.add(forest);
        mapGames.add(village);
        mapGames.add(accommodation);
        mapGames.add(temple);
        mapGames.add(topTemple);
        mapGames.add(basement);
        mapGames.add(nursery);
        mapGames.add(boat);
    }

